package com.hunter.sys.entity;import com.hunter.base.entity.BaseEntity;/** * @Author zhangcl * @Date 16/7/9  下午5:56 */public class SysUser extends BaseEntity {    private String code;    private String name;    private String phone;    private String sex;    private String password;    private String email;    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPhone() {        return phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    public String getSex() {        return sex;    }    public void setSex(String sex) {        this.sex = sex;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    @Override    public String toString() {        return "SysUser{" +                "code='" + code + '\'' +                ", name='" + name + '\'' +                ", phone='" + phone + '\'' +                ", sex='" + sex + '\'' +                ", password='" + password + '\'' +                ", email='" + email + '\'' +                '}';    }}